import React, { useState, useEffect } from 'react';

import "./collection.css";


const indexView = () => {
    const [indexView, setindexView] = useState(null);
  
    useEffect(() => {
        getindexView();
    }, []);

    const getindexView = async () => {
        const response = await fetch("https://www.thequint.com/api/v1/collections/home");
        const data = await response.json();
    
        setindexView(data.stories);
      };

      return (
        <div className="collection-list">
          {
            indexView && indexView.map((item, index) => <div key={index} className="collection-name">{item.name}</div>)
          }
        </div>
      );
    };
    export default indexView;
